create table zn_car
(
    id                     bigint                                  not null comment '唯一标识'
        primary key,
    parking_lot_id         bigint                                  null comment '停车场id',
    parking_lot_name       varchar(255)                            null comment '停车场名字',
    parking_area_id        bigint                                  null comment '车区id',
    parking_area_name      varchar(255)                            null comment '车区名称',
    parking_space_id       bigint                                  null comment '车位id',
    parking_space_num      varchar(20)                             null comment '车位编号',
    parking_space_full_num varchar(255)                            null comment '车位的全名',
    user_id                bigint                                  null comment '用户id',
    car_plate_number       varchar(20)                             null comment '车牌号',
    car_color              varchar(20)                             null comment '车辆颜色',
    car_type               varchar(20)                             null comment '车辆类型',
    car_brand              varchar(20)                             null comment '车辆品牌',
    heavy_point            tinyint(1) default 0                    null comment '是否重点车辆0非重点，1重点',
    mark_time              datetime                                null comment '重点标记变更时间',
    create_id              bigint                                  null comment '创建人id',
    create_by              varchar(60) collate utf8mb4_general_ci  null comment '创建人',
    create_dept            bigint                                  null comment '创建部门',
    create_time            datetime                                null comment '创建时间',
    update_id              bigint                                  null comment '更新人id',
    update_by              varchar(60) collate utf8mb4_general_ci  null comment '更新人',
    update_time            datetime                                null comment '更新时间',
    del_flag               tinyint(1) default 0                    null comment '删除标记',
    remark                 varchar(255) collate utf8mb4_general_ci null comment '备注',
    up_flag                int                                     null comment '0 未上传 1 上传中 2 已上传',
    up_count               int                                     null comment '上传次数',
    up_msg                 varchar(255)                            null comment '上传信息',
    up_id                  varchar(255)                            null comment '上传ID'
)
    comment '车辆' collate = utf8mb4_unicode_ci;

